import React from "react";
import { render } from "react-dom";
import { BrowserRouter } from "react-router-dom";

import App from "./App";
import { ProductsContext } from "./context/product.context";
import { UserProvider } from "./context/user.context";

import "./index.scss";

const rootElement = document.getElementById("root");

render(
  <React.StrictMode>
    <BrowserRouter>
      <UserProvider>
        <ProductsContext> {/* Products provider will have acces to user state but not the other way around */}
          <App />
        </ProductsContext>
      </UserProvider>
    </BrowserRouter>
  </React.StrictMode>,
  rootElement
);
